import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        alignItems: "center"
    },
    inputContainer: {
      flexDirection: "row",
      alignItems: "center",
      paddingHorizontal: 15,
      borderWidth: 2,
      borderRadius: 6,
      width: "90%",
      marginTop: 20
    },    
    icon: {
      width: 25,
      height: 25,
      marginRight: 5,
    },
    input: {
      flex: 1,
      height: 40,
    },

  });
   
  export default styles
